import { Link } from 'react-router-dom';

function OurTeam() {
    return (
        <div className='Team'>
             <li>
                <ul><Link to='/our-team' className="link">Our Team</Link></ul>
                <ul><Link to='/' className="link">Portal</Link></ul>
            </li>
        </div>
    )
}

export default OurTeam;
